import React, { useState, useEffect } from 'react';
import { useLocation } from 'react-router-dom';
import axios from 'axios';
import '../App.css';

function Home() {
  const [fileDetails, setFileDetails] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
      const fetchFileDetails = async () => {
          try {
              const response = await axios.get(`http://localhost:3000/files/${match.params.id}`);
              setFileDetails(response.data);
              setLoading(false);
          } catch (err) {
              setError(err.response ? err.response.data : err.message);
              setLoading(false);
          }
      };

      fetchFileDetails();
  }, [match.params.id]);

  if (loading) return <p>Loading...</p>;
  if (error) return <p>Error: {error.message}</p>;

  return (
    <div className='css-Home1'>
      <header>
        Welcome, {userData ? userData.name : 'Guest'}
      </header>

      <div className='css-Home'>
        <div className='css-Home2'>
        <div>
            <h1>รายละเอียดไฟล์</h1>
            {fileDetails ? (
                <div>
                    <p><strong>ชื่อเต็ม:</strong> {fileDetails.full_name}</p>
                    <p><strong>เรื่อง:</strong> {fileDetails.subject}</p>
                    <p><strong>จาก:</strong> {fileDetails.from_sender}</p>
                    <p><strong>ถึง:</strong> {fileDetails.to_recipient}</p>
                    <p><strong>URL ไฟล์:</strong> <a href={fileDetails.file_url} target="_blank" rel="noopener noreferrer">ดาวน์โหลดไฟล์</a></p>
                    <p><strong>หมายเหตุ:</strong> {fileDetails.notes}</p>
                </div>
            ) : (
                <p>ไม่มีรายละเอียดไฟล์</p>
            )}
        </div>
        
          <h2>User Information</h2>

          <table className='user-table'>
            <thead>
              <tr>
                <th>ชื่อ</th>
                <th>เรื่อง</th>
                <th>สถานะ</th>
                <th>ผู้ดำเนินการ</th>
                <th>ระดับ</th>
              </tr>
            </thead>
            <tbody>
              {data.map((item, index) => (
                <tr key={index}>
                  <td>{item.name}</td>
                  <td>{item.subject}</td>
                  <td>{item.status}</td>
                  <td>{item.operator}</td>
                  <td>{item.level}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
}

export default Home;
